import * as React from "react";
import Header from "../component/Header";

function Home() {
  return (
    <>
      <Header />
      <Box component="main" sx={{ p: 3, mt: 8 }}>
        <Grid container spacing={2} maxWidth="lg" justifyContent="space-evenly">
          <Grid item xs={12} md={3}>sdagdsfgbdf</Grid>
          <Grid item xs={12} md={3}>dfgbdfgdf</Grid>
          <Grid item xs={12} md={3}>fdgdfgdf</Grid>
          <Grid item xs={12} md={3}>fdgdfgdf</Grid>
        </Grid>
      </Box>
    </>
  );
}
export default Home;
